import React from "react";
import { ButtonWithIcon } from "./ButtonWithIcon";
import { DropDownMenu } from "./DropDownMenu";
import { IconComponentNode } from "./IconComponentNode";
import { LogoMenu } from "./LogoMenu";
import { User } from "./User";
import "./style.css";

export const OrderchemotherapyPage = () => {
  return (
    <div className="order-chemotherapy">
      <div className="div">
        <div className="navigation">
          <div className="text-wrapper-2">Patient List</div>
          <img className="img" alt="Vector" src="vector-2.svg" />
          <div className="text-wrapper-3">Hazem Abdulnasser</div>
          <img className="img" alt="Vector" src="vector-3.svg" />
          <div className="text-wrapper-4">Chemo Orders</div>
        </div>
        <div className="text-wrapper-5">Select regimen</div>
        <DropDownMenu className="drop-down-menu-instance" />
        <div className="header" />
        <div className="button-and-user">
          <User
            divClassName="user-instance"
            maskGroup="mask-group-2.png"
            stateProp="default"
            text="Dr. Hesham"
            vector="vector-4.svg"
          />
          <ButtonWithIcon
            className="button-with-icon-instance"
            override={<IconComponentNode className="icons-2" />}
            stateProp="default"
            text="Log out"
          />
        </div>
        <LogoMenu className="logo-menu" />
      </div>
    </div>
  );
};
